INSERT INTO `pro_cms` (`id`, `kind`, `time`, `title`, `content`, `ex_1`) VALUES
(16, 1, '2013-09-09 06:57:13', '西安交大校领导深入基层听取师生意见和建议', '<p class="MsoNormal" style="color:#333333;text-indent:2em;font-size:14px;font-family:Simsun;">\r\n	<span><span>&nbsp;</span></span><span><span>9</span></span><span style="font-family:宋体;">月</span><span><span>6</span></span><span style="font-family:宋体;">日</span><span style="font-family:宋体;">，西安交通大学郑南宁校长分别邀请基层教师和离退休老同志，聚焦干部“四风”问题，进行座谈交流，专门听取基层群众对学校领导班子及学校中心工作的意见和建议。校党委常务副书记王小力、总务长耿剑平、校长助理席光陪同调研，党校办、组织部、科研院、人力资源部、财务处、教务处、研究生院、住房处、重点办、物业处、校医院等职能部门负责人列席有关会议。</span>\r\n</p>\r\n<p class="MsoNormal" style="color:#333333;text-indent:2em;font-size:14px;font-family:Simsun;">\r\n	<span style="font-family:宋体;">郑南宁校长表示，做好群众路线教育实践活动是当前推进学校各项工作的重要契机和抓手。他说，“四风不是有没有的问题，而是多和少的问题。大家对学校工作的意见和建议，所在基层单位、所从事工作中的困难、问题都可以敞开谈，不用顾虑。”</span>\r\n</p>\r\n<p class="MsoNormal" style="color:#333333;text-indent:2em;font-size:14px;font-family:Simsun;">\r\n	<span style="font-family:宋体;">在上午的基层教师代表座谈会上，与会教师针对干部“四风”，从自身实际出发，列举了在教学、科研工作中存在的问题，分析了原因，并提出中肯的建议。机械学院陈雪峰分析了本科生实验教学中存在的问题；公管学院杨东朗认为，要让最普通的教师感受到办事越来越方便，效率越来越高；化工学院沈人杰说，各项制度要规范化，并严格执行；经金学院杨秀云提议继续加大对教学的重视程度；航天学院张亚红建议规章制度要细化，做到有据可依；电气学院徐阳呼吁更多关注专业技术人员；外语学院许明针对教师评价考核体系存在的问题进行了客观的分析；法学院丁卫希望学校对法学期刊建设给予更多支持；人文学院宋希斌则建议主楼大教室配备移动麦克；一附院杜明才说出了自己对研究生生源质量的担忧，并提出了改进建议。</span>\r\n</p>\r\n<p class="MsoNormal" style="color:#333333;text-indent:2em;font-size:14px;font-family:Simsun;">\r\n	<span style="font-family:宋体;">在下午的离退休老同志座谈会上，老同志集中反映了他们在待遇、住房及周边环境、医疗等方面的问题和关切，并结合切身体会，对改进干部作风，提出了建议，如：管理工作要更加精细化，注重细节、以人为本，职能部门要切实为基层群众谋福利，关心、服务好广大教职员工的工作和生活；科学决策更加规范民主，保障政策连贯性和权威性，政策制定更加反映民意；完善民主监督体制，支持更多民主监督团体的发展，无缝对接民主监督与职能部门，更好做到信息对称，政务公开；调查研究要更加深入基层，广泛听取基层广大群众的意见，不浮于表面，不流于形式；切实回应群众关切，建立完善反馈机制，对于群众意见较为集中的问题要加强沟通，切实整改。</span>\r\n</p>\r\n<span style="color:#333333;font-family:宋体;font-size:14px;line-height:21px;">&nbsp;&nbsp;&nbsp;&nbsp;郑南宁校长认真听取了每一位代表的发言，做好记录，并现场与参会代表进行了互动交流。他表示参会人员谈得很深入，不仅反映了问题还指出了问题根源，校领导班子和职能部门将认真梳理查摆的问题，尽快制定出整改方案并付诸实际工作，在查摆问题的基础上更好地解决问题，建章立制。他特别强调，学校各级领导干部要牢固树立群众意识，在合理合法的前期下，学校和职能部门一定要站在师生群众的立场上，改进管理和服务工作，切实维护广大师生群众的利益。除了座谈会等形式外，广大师生员工还可以通过部门邮箱、校领导信箱等校务公开的方式表达自己的建议和意见，为学校的建设建言献策。</span><br />', ''),
(17, 1, '2013-09-09 07:00:34', '西安交大举行暑期工作会议扎实推进群众路线教育实践活动', '<p>\r\n	<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;9</span><span style="font-family:宋体;">月</span><span>4</span><span style="font-family:宋体;">日</span><span style="color:#333333;font-size:14px;line-height:21px;font-family:宋体;">至</span><span style="color:#333333;font-family:Simsun;font-size:14px;line-height:21px;">5</span><span style="color:#333333;font-size:14px;line-height:21px;font-family:宋体;">日，西安交大举行暑期工作会议，围绕“贯彻党的群众路线，切实改进工作作风”的主题，结合学校各项事业的发展，讨论推进群众性教育实践活动的深入开展，进一步提高认识、交流经验、查摆和解决问题。党委书记王建华、校长郑南宁分别作大会报告，常务副书记王小力对学校党的群众路线教育实践活动相关工作进行说明并提出具体要求。学校党政领导、总务长、校长助理，学院、国家重点科研基地主要负责人，机关、直属、书院、社会服务及附属单位主要负责人，各民主党派、侨联基层组织负责人等共</span><span style="color:#333333;font-family:Simsun;font-size:14px;line-height:21px;">138</span><span style="color:#333333;font-size:14px;line-height:21px;font-family:宋体;">人参加会议。</span>\r\n</p>\r\n<p>\r\n	<span style="color:#333333;font-size:14px;line-height:21px;font-family:宋体;">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<img src="http://xjtunews.xjtu.edu.cn/zhxw/resource/h000/h74/img201309061318300.jpg" alt="" /><br />\r\n</span>\r\n</p>\r\n<p>\r\n	<span style="color:#333333;font-size:14px;line-height:21px;font-family:宋体;">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<img src="http://xjtunews.xjtu.edu.cn/zhxw/resource/h000/h74/img201309061318301.jpg" alt="" /><br />\r\n</span>\r\n</p>\r\n<p>\r\n	<span style="color:#333333;font-size:14px;line-height:21px;font-family:宋体;">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<img src="http://xjtunews.xjtu.edu.cn/zhxw/resource/h000/h74/img201309061318301.jpg" alt="" /><br />\r\n</span>\r\n</p>\r\n<p>\r\n	<span style="color:#333333;font-size:14px;line-height:21px;font-family:宋体;"><span style="color:#333333;font-family:楷体_GB2312;font-size:14px;line-height:21px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;西安交大召开暑期工作会议</span><br />\r\n</span>\r\n</p>\r\n<p>\r\n	<span style="color:#333333;font-size:14px;line-height:21px;font-family:宋体;"><span style="color:#333333;font-family:宋体;font-size:14px;line-height:21px;">&nbsp;&nbsp;&nbsp;&nbsp;王建华书记作“提高认识、找准问题，扎实推进党的群众路线教育实践活动的深入开展”报告，通报了暑期学校各单位开展群众性教育实践活动的情况，交流了自己暑期学习群众路线教育实践活动的体会和心得。他强调要进一步提高认识，准确把握学习实践活动的核心和重点。他说，学习实践活动不是一般的找找工作差距，分析分析问题，而是要查找存在问题更加本质的原因，要深挖思想根源，作风根源。要查摆“形式主义、官僚主义、享乐主义、奢靡之风”在学校的具体体现，要查找这些表现后面的思想根源，从而真正认识到“四风”之害，树立新风正气，促进学校工作全面健康发展。</span><br />\r\n</span>\r\n</p>\r\n<p>\r\n	<span style="color:#333333;font-size:14px;line-height:21px;font-family:宋体;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <img src="http://xjtunews.xjtu.edu.cn/zhxw/resource/h000/h74/img201309061320570.jpg" alt="" /><br />\r\n</span>\r\n</p>\r\n<p>\r\n	<span style="color:#333333;font-size:14px;line-height:21px;font-family:宋体;"><span style="color:#333333;font-size:10.5pt;line-height:21px;font-family:楷体_GB2312;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;党委书记王建华作大会报告</span><span style="color:#333333;font-family:宋体;font-size:14px;line-height:21px;">&nbsp; &nbsp;</span><br />\r\n</span>\r\n</p>\r\n<p>\r\n	<span style="color:#333333;font-size:14px;line-height:21px;font-family:宋体;"><span style="color:#333333;font-family:宋体;font-size:14px;line-height:21px;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;王书记在报告中深入分析了“四风”在西安交大的表现形式以及因此而产生的主要问题，包括决策不科学、管理执行力不强、管理服务作风问题、社会主义现代大学制度建设、学科建设不平衡问题、队伍建设的问题、人才培养和提高教学质量问题、面向经济社会发展问题、学风问题、勤俭节约问题等等。指出要解决这些问题，首先要从思想上和作风上正视和认识到这些问题的根源；其次要从内部和自身找原因，领导干部要做出表率，以身作则</span><a name="_GoBack"></a><span style="color:#333333;font-family:宋体;font-size:14px;line-height:21px;">；还要认真研究相关制度，堵住漏洞，建立长效机制，同时通过思想教育活动，广泛教育干部群众，要从群众中寻求智慧，在认识和行动上达成共识，齐心协力切实和真正解决问题。强调要真正克服“四风”，核心和根本是要做到“实事求是、真抓实干、勤俭节约、艰苦奋斗”。</span><br />\r\n</span>\r\n</p>\r\n<p>\r\n	<span style="color:#333333;font-size:14px;line-height:21px;font-family:宋体;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<img src="http://xjtunews.xjtu.edu.cn/zhxw/resource/h000/h74/img201309061321280.jpg" alt="" /><br />\r\n</span>\r\n</p>\r\n<p>\r\n	<span style="color:#333333;font-size:14px;line-height:21px;font-family:宋体;"><span style="color:#333333;font-family:楷体_GB2312;font-size:14px;line-height:21px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;郑南宁校长在大会上作报告</span><br />\r\n</span>\r\n</p>\r\n<p>\r\n	<span style="color:#333333;font-size:14px;line-height:21px;font-family:宋体;">\r\n	<p class="MsoNormal" style="color:#333333;text-indent:2em;font-size:14px;font-family:宋体;">\r\n		郑南宁校长在报告中，结合学校的中心工作，分析了制约学校发展的几个问题，提出几点值得思考的问题和建议。强调要加强领导班子思想建设，树立群众观念，指出要从思想上尊重师生、感情上贴近师生、工作上依靠师生，坚持依靠和引导群众两手抓，坚持对师生的引导和教育的统一，以此来牢固树立正确的群众观。同时，要把西安交大建成人民群众满意的世界知名高水平大学的美好景愿作为师生共同前进的动力，还要从思想上认识到当前的差距，并将其内化为改革创新的动力，形成良好的大学文化氛围。\r\n	</p>\r\n	<p class="MsoNormal" style="color:#333333;text-indent:2em;font-size:14px;font-family:宋体;">\r\n		<span>郑南宁校长深入分析和梳理了前期调研工作中反映出的几个突出问题，要抓住群众性教育实践活动的“教育、实践”两个基本点，针对下一步群众教育实践活动，他提出要结合学校八个方面主要工作深入展开的具体要求。</span>\r\n	</p>\r\n	<p class="MsoNormal" style="color:#333333;text-indent:2em;font-size:14px;font-family:宋体;">\r\n		<span>与会人员分成七个小组进行分组讨论，结合学习调研和听取群众意见情况，分析学校和部门在贯彻党的群众路线和工作作风方面存在的突出问题，提出整改意见和建议。荣命哲、郑庆华、颜虹、席光、贾申利、尚春阳、贾箭鸣等代表各组发言，汇报交流各组讨论情况。各组分享了对本次群众路线教育实践活动的思想认识，结合当前工作重点对学校未来发展和深入开展群众性教育实践活动提出具体的整改思路和可行措施。大家一致认为，王书记和郑校长的报告，根据中央和教育部的要求，紧密结合学校实际，比较系统全面地总结了当前学校在管理、教学、人才培养、学科建设、民生、教风、学风等各个层面存在的</span><span>“</span><span>四风</span><span>”</span><span>问题，实事求是，不遮不掩，强调改进</span><span>“</span><span>四风</span><span>”</span><span>问题的根本在于</span><span>“</span><span>提高思想认识，牢固树立群众观点，充分发挥广大师生的积极性，切实尊重师生的主体地位</span><span>”</span><span>，并倡导从学校领导自身做起，上行下效，本着</span><span>“</span><span>踏实留印、打铁留印</span><span>”</span><span>的求真务实的态度，认真解决群众关切的问题。这对学校今后工作的正本清源、真抓实干将起到重要的引领作用。大家还指出，学校当前在顶层设计、决策体系、分类管理、人才培养、队伍建设、职员体系、民生工程以及师德、师风、学风等方面存在的突出问题，并结合本职工作提出建议和思考。</span>\r\n	</p>\r\n<br />\r\n</span>\r\n</p>\r\n<p>\r\n	<span style="color:#333333;font-size:14px;line-height:21px;font-family:宋体;"><br />\r\n</span>\r\n</p>', ''),
(18, 1, '2013-09-09 07:04:27', '校领导赴宝鸡慰问学生赛艇队', '<p>\r\n	<span style="color:#333333;font-family:Simsun;font-size:14px;line-height:21px;"><span>&nbsp;&nbsp;&nbsp;&nbsp;8</span></span><span style="color:#333333;font-size:14px;line-height:21px;font-family:宋体;">月</span><span style="color:#333333;font-family:Simsun;font-size:14px;line-height:21px;"><span>29</span></span><span style="color:#333333;font-size:14px;line-height:21px;font-family:宋体;">日下午，校党委常务副书记王小力、副书记宫辉专程到陕西省水上运动中心宝鸡王家崖训练基地慰问正在紧张备战的学生赛艇队。党校办、宣传部、学生处、研究生院、教务处、校园事务与物业服务处、就业指导中心、团委、国际学院及相关学院、书院部分负责人参加慰问活动。</span>\r\n</p>\r\n<p>\r\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<img src="http://xjtunews.xjtu.edu.cn/xssh/resource/h000/h74/img201309061724080.jpg" alt="" />\r\n</p>\r\n<p>\r\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img src="http://xjtunews.xjtu.edu.cn/xssh/resource/h000/h74/img201309061724081.jpg" alt="" />\r\n</p>\r\n<p>\r\n	<span style="color:#333333;font-family:Simsun;font-size:14px;line-height:21px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span><span style="color:#333333;font-size:14px;line-height:21px;font-family:楷体;">校领导赴宝鸡慰问学生赛艇队</span>\r\n</p>\r\n<p>\r\n	<p class="MsoNormal" style="color:#333333;text-indent:2em;font-size:14px;font-family:Simsun;">\r\n		<span style="font-family:宋体;">在慰问座谈会上，赛艇队队员首先汇报了参加第四届国际名校赛艇挑战赛以及备战第五届西安交大与第四军医大学赛艇对抗赛的训练情况。队员王为同学在发言中表示，今年的集训时间能够充分保证，训练系统性和针对性更强，国际名校赛艇挑战赛为全队积累了宝贵的经验，队员们对第五届赛艇对抗赛充满信心。队员王聪同学认为，女子赛艇队在今年</span><span><span>7</span></span><span style="font-family:宋体;">月第一次参加国际名校赛艇挑战赛，并且是国内唯一一支代表队，划出了自己的最好成绩，但是要看到与其他国际名校的差距，后面还要继续刻苦训练，不断提高竞技水平。<br />\r\n</span><span></span>\r\n	</p>\r\n	<p class="MsoNormal" style="color:#333333;text-indent:2em;font-size:14px;font-family:Simsun;">\r\n		<span style="font-family:宋体;">王小力常务副书记指出，自</span><span><span>2009</span></span><span style="font-family:宋体;">年学生赛艇队成立以来，学校高度重视赛艇运动的发展。经过</span><span><span>5</span></span><span style="font-family:宋体;">年的建设，赛艇队培养了一批优秀的学子，也彰显了独特的体育精神，希望同学们继续拼搏，再接再厉，力争在第五届对抗赛中取得好成绩。</span><span></span>\r\n	</p>\r\n	<p class="MsoNormal" style="color:#333333;text-indent:2em;font-size:14px;font-family:Simsun;">\r\n		<span style="font-family:宋体;">会上，宫辉副书记向教练组赠送了慰问品。学生处、研究生院、教务处、就业指导中心等职能部门和相关书院、学院分别向队员代表们赠送了慰问品。留学生队员代表马丁在发言中想前来慰问的领导和老师表示感谢。</span><span></span>\r\n	</p>\r\n	<p class="MsoNormal" style="color:#333333;text-indent:2em;font-size:14px;font-family:Simsun;">\r\n		<span style="font-family:宋体;">座谈会结束后，慰问团一行到水上观摩了赛艇队男子八单、女子八单、男子四单的训练情况。</span>\r\n	</p>\r\n</p>', ''),
(19, 1, '2013-09-09 07:06:36', '西安交大召开2013级新生基础学科拔尖学生培养试验计划选拔动员会', '<span style="color:#333333;font-family:Simsun;font-size:14px;line-height:21px;"><span>&nbsp;&nbsp;&nbsp;&nbsp;9</span></span><span style="color:#333333;font-size:14px;line-height:21px;font-family:宋体;">月</span><span style="color:#333333;font-family:Simsun;font-size:14px;line-height:21px;"><span>2</span></span><span style="color:#333333;font-size:14px;line-height:21px;font-family:宋体;">日晚，西安交大</span><span style="color:#333333;font-family:Simsun;font-size:14px;line-height:21px;"><span>2013</span></span><span style="color:#333333;font-size:14px;line-height:21px;font-family:宋体;">年“基础学科拔尖学生培养试验计划”选拔动员会在主楼多功能报告厅召开，副校长徐宗本、校长助理郑庆华、理学院院长李福利拔尖人才培养办公室副主任杨森等参加会议。<br />\r\n</span>\r\n<p>\r\n	<span style="color:#333333;font-size:14px;line-height:21px;font-family:宋体;">&nbsp;&nbsp;&nbsp; 徐宗本副校长向同学们作了题为“</span><span style="color:#333333;font-size:14px;line-height:21px;font-family:宋体;">漫谈数学与信息技术”的专题报告。他说，基础学科的作用是厚积薄发，希望同学们能够沉下心，耐住寂寞，放远目光，轻松而快乐的学习，并且表达了对新生的殷切希望，相信同学们最终会学有所成，成就自己心中的理想。</span>\r\n</p>\r\n<p>\r\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img src="http://xjtunews.xjtu.edu.cn/jxxx/resource/h000/h74/img201309061051090.jpg" alt="" />&nbsp; &nbsp;\r\n</p>\r\n<p>\r\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img src="http://xjtunews.xjtu.edu.cn/jxxx/resource/h000/h74/img201309061051220.jpg" alt="" />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<p class="MsoNormal" style="color:#333333;text-indent:2em;font-size:14px;font-family:Simsun;">\r\n		<span style="font-family:宋体;">&nbsp;校长助理郑庆华介绍了基础学科拔尖学生培养试验计划设立的整体情况并阐述了交大理科试验班的培养优势和教学特色。理学院院长李福利与数学与统计学院王卫分别介绍了物理试验班和数学试验班的基本情况，欢迎新同学加入到理科试验班中成就梦想。各位老师也就同学们所关心的问题进行了解答。</span><span></span>\r\n	</p>\r\n	<p class="MsoNormal" style="color:#333333;text-indent:2em;font-size:14px;font-family:Simsun;">\r\n		<span style="font-family:宋体;">教育部“基础学科拔尖学生培养试验计划”旨在培养具有国际一流水平的基础学科领域拔尖人才，西安交通大学是首批入选该计划的大学之一。试验班单独编班、独立授课，学校制订了专门的教学计划，提供一流的学习条件，营造一流的学习环境和氛围，并从国内外聘请一流的师资，因材施教，进行个性化培养，力争培养出具有一定专业素养的科学研究型人才。</span>\r\n	</p>\r\n</p>', ''),
(21, 1, '2013-09-09 07:07:31', '西安交大召开群众路线教育实践活动领导小组办公室会议', '<p class="MsoNormal" style="color:#333333;text-indent:2em;font-size:14px;font-family:Simsun;">\r\n	<span><span>9</span></span><span style="font-family:宋体;">月</span><span><span>4</span></span><span style="font-family:宋体;">日，西安交大召开群众路线教育实践活动领导小组办公室第三次全体会议，认真学习中央有关精神，部署教育实践活动的下一步工作，明确工作要求。校党委常务副书记王小力、副校长闫剑群、副书记赵昌昌，群众路线教育实践活动领导小组办公室成员参加会议。</span><span></span>\r\n</p>\r\n<p class="MsoNormal" style="color:#333333;text-indent:2em;font-size:14px;font-family:Simsun;">\r\n	<span style="font-family:宋体;">会上，组织部部长张定红简要汇报了暑假期间教育实践活动的开展情况。从总体上看，暑假期间全校教育实践活动组织有序。学校领导班子按照“边学习边调研边整改”的要求，于</span><span><span>8</span></span><span style="font-family:宋体;">月</span><span><span>30</span></span><span style="font-family:宋体;">日组织召开了专题学习会，带头抓好集中学习。校领导结合分管工作深入基层开展调研，广泛听取意见，围绕“四风”梳理问题，深挖根源。各分党委结合本单位实际，安排开展了学习调研工作。</span><span></span>\r\n</p>\r\n<p class="MsoNormal" style="color:#333333;text-indent:2em;font-size:14px;font-family:Simsun;">\r\n	<span style="font-family:宋体;">党委副书记赵昌昌通报了学校通过综合各方意见，梳理出的在教学、科研、行政管理等方面的存在的问题及“四风”的具体表现，以及关于教育乱收费、房屋资产管理、外地研究院等专项治理工作开展情况。他强调，在接下来的工作中要着重聚焦群众关切、意见突出的问题，切实加强制度建设，并将治理任务分解到各部门及责任人，保证整改落到实处。</span><span></span>\r\n</p>\r\n<p class="MsoNormal" style="color:#333333;text-indent:2em;font-size:14px;font-family:Simsun;">\r\n	<span style="font-family:宋体;">王小力常务副书记传达了中央关于中管高校开展教育实践活动的指示精神。中央要求，中管高校在教育实践活动中，要以“教育”和“实践”为两个基本点，抓好干部集中教育，把活动作为推进学校工作的基本抓手和重要契机。保障活动不走过场，一是要提高思想认识，深挖高校干部在“四风”方面的具体表现；二是要找准问题，要处理好一般问题和个别问题，“照镜子”与听取群众意见的关系，挖掘问题根源，开展集体研究；三是要开好民主生活会，不能简单汇报、评功摆好，要认真做好会前准备工作；四是要抓好整改，要让群众实实在在看到各级领导班子状态的变化；五是要抓好一把手带头。</span><span></span>\r\n</p>\r\n<p class="MsoNormal" style="color:#333333;text-indent:2em;font-size:14px;font-family:Simsun;">\r\n	<span style="font-family:宋体;">王小力常务副书记分析了当前活动中存在的问题，并对下一步教育实践活动的开展提出了具体要求。他指出，领导小组办公室要按照中央“持续深化教育实践活动，在干部中形成思想自觉与行为自觉”的要求，从严、从紧抓好党员干部学习，力争做到全覆盖；要深入基层做好调研，切实接地气，梳理问题要得到广大党员、基层群众的认可；整改工作立即展开，不能避重就轻；扎实准备前期工作，开好民主生活会；认真学习习近平总书记“</span><span><span>8.19</span></span><span style="font-family:宋体;">”讲话精神，扎实做好宣传工作，树立典型，及时交流活动经验。</span>\r\n</p>', ''),
(22, 1, '2013-09-09 07:08:16', '西安交大校领导深入基层听取师生意见和建议', '<p class="MsoNormal" style="color:#333333;text-indent:2em;font-size:14px;font-family:Simsun;">\r\n	<span><span>9</span></span><span style="font-family:宋体;">月</span><span><span>6</span></span><span style="font-family:宋体;">日</span><span style="font-family:宋体;">，西安交通大学郑南宁校长分别邀请基层教师和离退休老同志，聚焦干部“四风”问题，进行座谈交流，专门听取基层群众对学校领导班子及学校中心工作的意见和建议。校党委常务副书记王小力、总务长耿剑平、校长助理席光陪同调研，党校办、组织部、科研院、人力资源部、财务处、教务处、研究生院、住房处、重点办、物业处、校医院等职能部门负责人列席有关会议。</span>\r\n</p>\r\n<p class="MsoNormal" style="color:#333333;text-indent:2em;font-size:14px;font-family:Simsun;">\r\n	<span style="font-family:宋体;">郑南宁校长表示，做好群众路线教育实践活动是当前推进学校各项工作的重要契机和抓手。他说，“四风不是有没有的问题，而是多和少的问题。大家对学校工作的意见和建议，所在基层单位、所从事工作中的困难、问题都可以敞开谈，不用顾虑。”</span>\r\n</p>\r\n<p class="MsoNormal" style="color:#333333;text-indent:2em;font-size:14px;font-family:Simsun;">\r\n	<span style="font-family:宋体;">在上午的基层教师代表座谈会上，与会教师针对干部“四风”，从自身实际出发，列举了在教学、科研工作中存在的问题，分析了原因，并提出中肯的建议。机械学院陈雪峰分析了本科生实验教学中存在的问题；公管学院杨东朗认为，要让最普通的教师感受到办事越来越方便，效率越来越高；化工学院沈人杰说，各项制度要规范化，并严格执行；经金学院杨秀云提议继续加大对教学的重视程度；航天学院张亚红建议规章制度要细化，做到有据可依；电气学院徐阳呼吁更多关注专业技术人员；外语学院许明针对教师评价考核体系存在的问题进行了客观的分析；法学院丁卫希望学校对法学期刊建设给予更多支持；人文学院宋希斌则建议主楼大教室配备移动麦克；一附院杜明才说出了自己对研究生生源质量的担忧，并提出了改进建议。</span>\r\n</p>\r\n<p class="MsoNormal" style="color:#333333;text-indent:2em;font-size:14px;font-family:Simsun;">\r\n	<span style="font-family:宋体;">在下午的离退休老同志座谈会上，老同志集中反映了他们在待遇、住房及周边环境、医疗等方面的问题和关切，并结合切身体会，对改进干部作风，提出了建议，如：管理工作要更加精细化，注重细节、以人为本，职能部门要切实为基层群众谋福利，关心、服务好广大教职员工的工作和生活；科学决策更加规范民主，保障政策连贯性和权威性，政策制定更加反映民意；完善民主监督体制，支持更多民主监督团体的发展，无缝对接民主监督与职能部门，更好做到信息对称，政务公开；调查研究要更加深入基层，广泛听取基层广大群众的意见，不浮于表面，不流于形式；切实回应群众关切，建立完善反馈机制，对于群众意见较为集中的问题要加强沟通，切实整改。<br />\r\n</span>\r\n</p>\r\n<span style="font-size:medium;line-height:normal;font-family:宋体;">\r\n<p align="center" style="color:#333333;text-indent:2em;font-size:14px;">\r\n	<a href="http://xjtunews.xjtu.edu.cn/zhxw/resource/h000/h74/img201309072127460.jpg" target="_blank"><img src="http://xjtunews.xjtu.edu.cn/zhxw/resource/h000/h74/img201309072127460.jpg" border="0" /></a><br />\r\n<span style="font-size:10.5pt;font-family:楷体_GB2312;">离退休老同志座谈会</span>\r\n</p>\r\n<p style="color:#333333;text-indent:2em;font-size:14px;">\r\n	郑南宁校长认真听取了每一位代表的发言，做好记录，并现场与参会代表进行了互动交流。他表示参会人员谈得很深入，不仅反映了问题还指出了问题根源，校领导班子和职能部门将认真梳理查摆的问题，尽快制定出整改方案并付诸实际工作，在查摆问题的基础上更好地解决问题，建章立制。他特别强调，学校各级领导干部要牢固树立群众意识，在合理合法的前期下，学校和职能部门一定要站在师生群众的立场上，改进管理和服务工作，切实维护广大师生群众的利益。除了座谈会等形式外，广大师生员工还可以通过部门邮箱、校领导信箱等校务公开的方式表达自己的建议和意见，为学校的建设建言献策。\r\n</p>\r\n</span>', ''),
