(9, 10, '10000000000', '500000', '10000000', '自我推荐材料2.docx|51cfea3545702.docx|2013-06-30', '自我推荐材料1.docx|51cfea3545fe8.docx|2013-06-30', '', '', '', '', '', '', '', '2', '在思想上，与党中央保持一致，坚持四项基本原则，认真学习三个代表重要思想。要求积极上进，热爱祖国、热爱人民，拥护中国共产党的领导、拥护各项方针政策，遵守国家的法律法规及各项规章制度积极向党组织靠拢，向党递交入党申请书；有很强的上进心，勇于批评与自我批评，树立了正确的人生观和价值观。服从命令，听众指挥。能严格遵守医院的各项规章制度的；能积极参加医院和科室组织的各项活动并能尊敬领导，团结同事。  在学习上，严格要求自己，凭着对成为一名优秀白衣天使的目标和知识的强烈追求，刻苦钻研，勤奋好学，态度端正，目标明确，基本上牢固的掌握了一些专业知识和技能，作到了理论联系实际；除了专业知识的学习外，还注意各方面知识的扩展，广泛的涉猎其他学科的知识，从而提高了自身的思想文化素质。', '状态', '2013-06-30', '2013-07-20', '2013-06-30', '可以看见', '市县级', '', '0', '', '');
